    "2013-03-15T23:37:43.512816",nt"name": "aasg-geothermal-data-geothermal-fluid-production-observation-content-model",nt"isopen":
    false,nt"url": null,nt"notes": "This workbook documents a content model
    for exchange of information about fluid fluxes into or out of a geothermal well.
    A generic  model is intended to allow for oil, gas, or water fluid transfer. Oil
    and gas facilities may include of-shore platforms, whereas water facilities may
    include geothermal power plants. Because of the wide variety of possible flow measurements
    (commodities, aggregation type), the model adopts a thin approach, which may result
    in many records being returned for a single well. Thus most data about the well
    is linked through the HeaderURI instead of included inline to keep the redundant
    data volume down.",nt"license_title": null,nt"extras": [{ntt"key":
